pragma solidity 0.8.0;






interface IOracle {
    function getPrice() external view returns (uint256);
}

contract ethBuying is Context, Ownable {
    using SafeMath for uint256;

    AggregatorV3Interface internal _priceETH;
    AggregatorV3Interface internal _priceLINK;

    address public _USDT = 0xdAC17F958D2ee523a2206206994597C13D831ec7;
    address public _USDC = 0xA0b86991c6218b36c1d19D4a2e9Eb0cE3606eB48;
    address public _LINK = 0x514910771AF9Ca656af840dff83E8264EcF986CA;
    address public _ROTHS;
    uint256 _balance = 105e23;
    bool public _started;
    uint256 public _startTime;
    address public oracle;

    constructor(address _rothsAddress) {
        _ROTHS = _rothsAddress;
        _priceETH = AggregatorV3Interface(
            0x5f4eC3Df9cbd43714FE2740f5E3616155c5b8419
        );
        _priceLINK = AggregatorV3Interface(
            0x2c1d072e956AFFC0D435Cb7AC38EF18d24d9127c
        );
    }

    function remainingROTHS() public view returns (uint256) {
        return _balance;
    }

    function getUSDPrice(uint256 _amount) public view returns (uint256) {
        return _amount.mul(_price()).div(1e18);
    }

    function getLINKPrice(uint256 _amount) public view returns (uint256) {
        return _amount.mul(_price()).mul(getLatestPrice(_priceLINK)).div(1e36);
    }

    function getETHPrice(uint256 _amount) public view returns (uint256) {
        return _amount.mul(_price()).mul(getLatestPrice(_priceETH)).div(1e36);
    }

    function setOracle(address _oracle) public virtual onlyOwner {
        oracle = _oracle;
    }

    function start() public virtual onlyOwner {
        require(_started == false, "Already started.");
        _started = true;
        _startTime = block.timestamp;
    }

    function buyUSDT(uint256 _amount) public virtual returns (bool) {
        require(_started == true, "Buying not yet started.");
        uint256 _rothsAmount = getUSDPrice(_amount*1e12);
        _buy(_USDT, _amount, _rothsAmount);
        return true;
    }

    function buyUSDC(uint256 _amount) public virtual returns (bool) {
        require(_started == true, "Buying not yet started.");
        uint256 _rothsAmount = getUSDPrice(_amount*1e12);
        _buy(_USDC, _amount, _rothsAmount);
        return true;
    }

    function buyLINK(uint256 _amount) public virtual returns (bool) {
        require(_started == true, "Buying not yet started.");
        uint256 _rothsAmount = getLINKPrice(_amount);
        _buy(_LINK, _amount, _rothsAmount);
        return true;
    }

    function buyETH() public payable returns (bool) {
        require(_started == true, "Buying not yet started.");
        uint256 _amount = msg.value;
        payable(owner()).transfer(_amount);
        uint256 _rothsAmount = getETHPrice(_amount);
        require(_rothsAmount <= _balance, "Not enough ROTHS in contract.");
        IERC20(_ROTHS).transfer(_msgSender(), _rothsAmount);
        _balance = _balance.sub(_rothsAmount);
        return true;
    }

    function _buy(
        address _tokenAddress,
        uint256 _amount,
        uint256 _rothsAmount
    ) internal virtual {
        IERC20(_tokenAddress).transferFrom(_msgSender(), owner(), _amount);
        require(_rothsAmount <= _balance, "Not enough ROTHS in contract.");
        IERC20(_ROTHS).transfer(_msgSender(), _rothsAmount);
        _balance = _balance.sub(_rothsAmount);
    }

    function _price() public view returns (uint256) {
        uint256 price_;
        price_ = IOracle(oracle).getPrice();
        return price_;
    }

    function getLatestPrice(AggregatorV3Interface priceFeed)
        internal
        view
        returns (uint256)
    {
        (,int256 price,,,) = priceFeed.latestRoundData();
        return uint256(price).mul(1e10);
    }
}
